export const textFieldStyle = {
    border: '1px #fff solid',
    borderRadius: '0.25em',
    margin: '0 1em 1em 0',
    '> *': {
        color: '#fff',
    }
}

export const textFieldProps = {
    style: {
        color: '#fff',
    }
}

export const submitButtonStyle = {
    color: '#98ce86',
    backgroundColor: 'rgba(45,45,45,0.8)',
    border: '1px #98ce86 solid',
    padding: '0.5em 1em 0.5em 1em',
    'a': {
        color: '#fff',
        textDecoration: 'none',
    },
    'a:visited': {
        color: '#fff',
        textDecoration: 'none',
    },
    ':hover': {
        border: '1px #98CE86 solid',
        color: '#fff',
        backgroundColor: '#68935A',
    },
}

export const submittedButtonStyle = {
    color: '#fff',
    backgroundColor: '#68935A',
    border: '1px #98CE86 solid',
    padding: '0.5em 1em 0.5em 1em',
    'a': {
        textDecoration: 'none',
        border: '1px #98CE86 solid',
        color: '#fff',
        backgroundColor: '#68935A',
    },
    'a:visited': {
        textDecoration: 'none',
        border: '1px #98CE86 solid',
        color: '#fff',
        backgroundColor: '#68935A',
    },
    ':hover': {
        border: '1px #98CE86 solid',
        color: '#fff',
        backgroundColor: '#68935A',
    },
}
